import React from "react";
const Pages = {
  BLANK_LINK: "#!",
  SIGNOUT: "../Pages/",
};

const Signin1 = React.lazy(() =>
  import("../Pages/Authentication/SignIn/SignIn1")
);

const route = [
  { path: "/auth/signin-1", exact: true, name: "Signin 1", component: Signin1 },
];

export default Pages;
